Erotico (Robby D., Digital Playground / WebDl / Split Scenes / 2013)

The sexy ladies of Erotico bring their unhindered sexual desires to the big screen. Meet Stoya, the injured ballerina who gives her ex lover, James Deen a final screw on the ballet bar. Next enjoy Bibi Jones and Bill Bailey, a couple who employs sadistic tactics to solidify their passion. Then, tough girl boxer Bonnie Rotten seduces a fan all the way to the shower where they release their aggression on one another. Afterwards, Monique Alexander satisfies, and then finally acknowledges his presence for an unbelievable bang. Lastly, Dani Daniels teases the heck out of her trainer, and brings him back for a workout he never would have imagined!

Monique Alexander, Dani Daniels, Stoya, BiBi Jones, James Deen, Bill Bailey, Bonnie Rotten

Feature, Widescreen

